import Navbar from './Navbar';
import { Link } from 'react-router-dom';
const Header = () => {
  return (
    <header>
      <div className="nav-area">
        <Link to="/" className="logo">
          Project 01
        </Link>
        <Navbar />
      </div>
    </header>
  );
};
export default Header;
